import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from '../axiosConfig';

const RegisterForm = () => {
    const [username, setUsername] = useState('');
    const [nombre, setNombre] = useState('');
    const [apellidos, setApellidos] = useState('');
    const [direccion, setDireccion] = useState('');
    const [password, setPassword] = useState('');
    const [email, setEmail] = useState('');
    const [cedula, setCedula] = useState('');
    const [errores, setErrores] = useState('');
    const [mensajeExito, setMensajeExito] = useState('');
    const navigate = useNavigate();

    const handleRegister = async () => {
        // Validación de campos
        if (!username || !nombre || !apellidos || !direccion || !cedula || !email || !password) {
            setErrores('Por favor, complete todos los campos.');
            setMensajeExito('');
            return;
        }

        try {
            await axios.post('http://localhost:8000/api/auth/register/', {
                username,
                nombre,
                apellidos,
                direccion,
                cedula,
                email,
                password,
            });
            setMensajeExito('Registro exitoso. Redirigiendo al inicio de sesión...');
            setErrores('');

            // Limpiar los campos
            setUsername('');
            setNombre('');
            setApellidos('');
            setDireccion('');
            setCedula('');
            setEmail('');
            setPassword('');

            // Redirigir al inicio de sesión después de 2 segundos
            setTimeout(() => navigate('/'), 2000);
        } catch (error) {
            console.error('Error en el registro:', error.response || error.message);
            setErrores(error.response?.data?.detail || 'Error en el registro, intente de nuevo.');
            setMensajeExito('');
        }
    };

    const handleReturnToLogin = () => {
        navigate('/');
    };

    return (
        <div className="registro-container">
            <div className="registro-form">
                <div className="card registro-card">
                    <div className="card-header text-center">
                        <h4>Crear una cuenta</h4>
                    </div>
                    <div className="card-body">
                        <div className="form-group mb-3">
                            <label className="form-label">Nombre de usuario</label>
                            <input
                                type="text"
                                className="form-control input-field"
                                placeholder="Escriba su nombre de usuario"
                                value={username}
                                onChange={(e) => setUsername(e.target.value)}
                            />
                        </div>
                        <div className="form-group mb-3">
                            <label className="form-label">Nombres</label>
                            <input
                                type="text"
                                className="form-control input-field"
                                placeholder="Escriba su nombre"
                                value={nombre}
                                onChange={(e) => setNombre(e.target.value)}
                            />
                        </div>
                        <div className="form-group mb-3">
                            <label className="form-label">Apellidos</label>
                            <input
                                type="text"
                                className="form-control input-field"
                                placeholder="Escriba sus apellidos"
                                value={apellidos}
                                onChange={(e) => setApellidos(e.target.value)}
                            />
                        </div>
                        <div className="form-group mb-3">
                            <label className="form-label">Cédula</label>
                            <input
                                type="text"
                                className="form-control input-field"
                                placeholder="Escriba su cédula"
                                value={cedula}
                                onChange={(e) => setCedula(e.target.value)}
                            />
                        </div>
                        <div className="form-group mb-3">
                            <label className="form-label">Dirección</label>
                            <input
                                type="text"
                                className="form-control input-field"
                                placeholder="Escriba su dirección"
                                value={direccion}
                                onChange={(e) => setDireccion(e.target.value)}
                            />
                        </div>
                        <div className="form-group mb-3">
                            <label className="form-label">Correo</label>
                            <input
                                type="email"
                                className="form-control input-field"
                                placeholder="Escriba su correo"
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                            />
                        </div>
                        <div className="form-group mb-3">
                            <label className="form-label">Contraseña</label>
                            <input
                                type="password"
                                className="form-control input-field"
                                placeholder="Escriba su contraseña"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                            />
                        </div>
                        <button className="btn btn-primary w-100 mt-4" onClick={handleRegister}>
                            Registrar
                        </button>
                        <button onClick={handleReturnToLogin} className="btn btn-primary w-100 mt-2">
                            Iniciar Sesión
                        </button>
                        {errores && <div className="alert alert-danger mt-3">{errores}</div>}
                        {mensajeExito && <div className="alert alert-success mt-3">{mensajeExito}</div>}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default RegisterForm;
